import { profile } from 'console';
import React from 'react'
import { IProfile } from '../Models/IProfile';
import './style.css'

interface IProps{
   profile:IProfile 
}
interface IState{

}
class GithubProfileCard extends  React.Component<IProps,IState>
{
    constructor(props:IProps)
    {
        super(props)
    }
    render(){
        let {profile}=this.props;
        return(
            <React.Fragment>
        <section>
                    
                <div className='card bg-light'>
                <img src={profile.avatar_url } alt='' className='img-fluid'/>
                <div className='card-body '>
                    <h3 className='text-center text-secondary'>{profile.name}</h3>
                    <p className='h6'>Profile id:{profile.id}</p>
                   bio: <small className='text-secondary'>{profile.bio} </small><br/>
                   Location:<h5>{profile.location}</h5>
                   Email:<h5>{profile.email}</h5>
                   <br/>
                   

<a className="btn btn-dark text-white btn-md" href={profile.html_url}role="button">html_url</a>
                </div>
                </div>
                </section>
            </React.Fragment>
        )
    }
};
export default GithubProfileCard;
